import "./semantic-ui/components/table.css"

import { useEffect, useState } from "react";

export default function TableOfficeTinknet() {
    const [dataAPI, setDataAPI] = useState([]);

    const getData = async () => {
        try {
            const response = await fetch("http://localhost:8000/api/dataoffice");
            const json = await response.json();
        } catch(error) {
            alert(error);
        }
    }

    return (
        <table class="ui celled table">
            <thead>
                <tr>
                    <th>No</th>
                    <th>Nama Perangkat</th>
                    <th>Jenis</th>
                    <th>Jumlah</th>
                    <th>Keterangan</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td data-label="id">1</td>
                    <td data-label="nama_perangkat">PC HP Z400 INTEL XEON</td>
                    <td data-label="jenis">PC SERVER</td>
                    <td data-label="jumlah">1</td>
                    <td data-label="status">AKTIF</td>
                </tr>
            </tbody>
        </table>
    )
}
